Final pics from the Winternats … We got beat E1 by eventual event winner Matt Hagan. We were the third quickest car of the first round of eliminations which was encouraging (but losing still sucks). Our new car is showing promise / completing runs in tough conditions. I am super proud of all the work the guys have put in. I need to keep improving, and we are hungry to take the next step as a team. 

Onto Vegas next 🎲 🎰

